var approverRecord = new GlideRecord('x_mscdx_demand_demand_approvers');
approverRecord.addQuery('u_active',true);
approverRecord.addQuery('u_module',current.u_module);
approverRecord.query();
	
if(approverRecord.hasNext()) {
	answer = approverRecord.u_approver;
} else {
	answer = gs.getProperty('x_mscdx_demand.applicationOwner');
}

